"original": |2-
     If more than one Contact is sent in a REGISTER request, the
     registering UA intends to associate all of the URIs in these Contact
     header field values with the address-of-record present in the To
     field.  This list can be prioritized with the "q" parameter in the
     Contact header field.  The "q" parameter indicates a relative
     preference for the particular Contact header field value compared to
     other bindings for this address-of-record.  Section 16.6 describes
     how a proxy server uses this preference indication.
"fixed": |-
  If more than one Contact is sent in a REGISTER request, the registering UA intends to associate all of the URIs in these Contact header field values with the address-of-record present in the To field.  This list can be prioritized with the "q" parameter in the Contact header field.  The "q" parameter indicates a relative preference for the particular Contact header field value compared to other bindings for this address-of-record.  Section 16.6 describes how a proxy server uses this preference indication.
"ko": |-
  REGISTER 요청에서 둘 이상의 연락처가 전송되는 경우 등록 UA는 이러한 연락처 헤더 필드 값의 모든 URI를 To 필드에 있는 레코드 주소와 연결하려고 합니다. 이 목록은 연락처 헤더 필드의 "q" 매개변수를 사용하여 우선순위를 지정할 수 있습니다. "q" 매개변수는 이 레코드 주소에 대한 다른 바인딩과 비교하여 특정 연락처 헤더 필드 값에 대한 상대적 선호도를 나타냅니다. 섹션 16.6에서는 프록시 서버가 이 기본 설정 표시를 사용하는 방법을 설명합니다.
